import React from 'react'
import styled from 'styled-components'

const SectionCards = styled.div`
position: relative;
z-index: 2;
background-color: #f8f9fa !important

@media (max-width: 991.98px)
{
    padding-top: 3rem;
    padding-bottom: 3rem;
}
`

const ContainerCards = styled.div`
width: 100%;
padding-right: 15px;
padding-left: 15px;
margin-right: auto;
margin-left: auto;

@media (min-width: 768px)
{
    max-width: 720px;
}
`

const Box = styled.div`
display: flex;
flex-wrap: wrap;
margin-right: -15px;
margin-left: -15px;
`
const Cards = ({title,text,img}) => {
    return (
    <SectionCards>
    <ContainerCards>
      <Box>
  <div class="col-6 col-md-6 col-lg-4 mb-4 mb-lg-5">
    <a href="service-single.html" class="block__16443 text-center d-block">
     <span class="custom-icon mx-auto">{img}</span>
      <h3>{title}</h3>
      <p class="d-sm-block">{text}</p>
    </a>
  </div>
     </Box>
  </ContainerCards>
  </SectionCards>

    )
}

export default Cards
